import React, { useState, useEffect } from "react";
import { useRoutes, usePath, A } from "hookrouter";

const DataCenter = () => {
  const [datas, setDatas] = useState([
    { name: "Alice", scores: [72, 64, 76, 80, 43] },
    { name: "Fred", scores: [80, 90, 78, 52, 63] },
    { name: "Zane", scores: [82, 94, 76, 90, 93] },
    { name: "Jim", scores: [50, 60, 70, 80, 90] }
  ]);

  const defaultUser = { name: "", scores: [] };
  const [user, setUser] = useState(defaultUser);

  const handleData = () => {
    console.log("handling data");
    let allScores = document.querySelectorAll(".score-card");

    allScores.forEach((card, i) => {
      card.className = "score-card";
      let score = card.getAttribute("score");
      if (score > 89) {
        card.classList.add("legendary-card");
      } else if (score > 79) {
        card.classList.add("epic-card");
      } else if (score > 69) {
        card.classList.add("rare-card");
      } else if (score > 59) {
        card.classList.add("green-card");
      } else if (score > 49) {
        card.classList.add("common-card");
      } else if (score < 50) {
        card.classList.add("trash");
      }
    });
  };

  const handleSort = () => {
    let dataCopy = [...datas];
    dataCopy.forEach((user, i) => {
      user.scores.sort(function(a, b) {
        return a - b;
      });
      setDatas(dataCopy);
    });
  };

  const handleCalculate = () => {
    let dataCopy = [...datas];
    dataCopy.forEach((user, i) => {
      let sum = user.scores.reduce((a, b) => a + b);
      let mean = sum / 5;
      user.sum = sum;
      user.mean = mean;
      setDatas(dataCopy);
    });
    console.log(dataCopy);
  };

  // Add new user Submit

  // const handleInputChange = e => {
  //   console.log(e.target.value);
  //   setUser({ ...user, ...e.target.value });
  //   console.log("not much");
  // };

  const handleSubmit = e => {
    e.preventDefault(); // stop reload
    let dataCopy = [...datas];
    let scoreArray = user.scores.split(",").map(Number);
    user.scores = scoreArray;
    dataCopy.push(user);
    setDatas(dataCopy);
    e.target.querySelectorAll("input").value = "";
  };

  useEffect(() => {
    Prism.highlightAll();
    handleData();
  }, []);

  useEffect(() => {
    console.log("data change");
    handleData();
  }, [datas]);

  useEffect(() => {
    console.log("new user");
  }, [user]);

  return (
    <div>
      <h3>Description:</h3>
      <p>
        A data focused app. In React state should be treated as immutable and so
        I've utilized the spread operator to clone our data structure (Array of
        objects, each of which has an array as one of it's properties) and
        modify that instead of the state directly.
      </p>
      <p>
        This app has color-coded scores for each user and can make some basic
        calculations on the scores as well as sort them in ascending order. The
        data is updated and the rendered elements bring their data attributes
        and classnames with them.
      </p>
      <h3>Render:</h3>
      <div className="app data-center">
        <div className="title">
          <h2> Data Center</h2>
        </div>

        <table id="data-table">
          <tbody>
            <tr>
              <td>Name:</td>
              <td>1</td>
              <td>2</td>
              <td>3</td>
              <td>4</td>
              <td>5</td>
              <td>Total:</td>
              <td>Average:</td>
            </tr>
            {datas.map((u, i) => (
              <tr className="user-row" key={i}>
                <td className="user-names">{u.name}:</td>
                {u.scores.map((score, i) => (
                  <td className="score-card" round={i} score={score} key={i}>
                    {score}
                  </td>
                ))}
                <td>{u.sum}</td>
                <td>{u.mean}</td>
              </tr>
            ))}
          </tbody>
        </table>
        <button onClick={() => handleSort()}>Sort</button>
        <button onClick={() => handleCalculate()}>Calculate</button>
        <h3>Add new user</h3>

        <form onSubmit={handleSubmit}>
          <label>Name</label>
          <input
            type="text"
            onInput={() => setUser({ ...user, name: event.target.value })}
          />
          <label>Scores</label>
          <input
            type="text"
            onInput={() => setUser({ ...user, scores: event.target.value })}
          />
          <button>Submit</button>
        </form>
        <p>{user.name}</p>
        <p>{user.scores}</p>
      </div>
      <h3> Code:</h3>
      <A href="/work" className="back-link">
        Back to Work
      </A>
    </div>
  );
};

export default DataCenter;
